import logo from "./logo.png";
import "./App.css";
import Dashboard from "./pages/dashboard/index";
import { Provider } from "react-redux";
import Bar from "./components/Navbar";
function App() {
  return (
    <div className="App">
      <Provider>
        <Bar />
        <Dashboard />
      </Provider>
    </div>
  );
}

export default App;
